if ( ! function_exists( 'olistener' ) ) {
	function olistener() {
		global $olistener;

		if ( empty( $olistener ) ) {
			$olistener = new Olistener_functions();
		}

		return $olistener;
	}
}


if ( ! function_exists( 'olistener_create_table' ) ) {
	/**
	 * Create table if not exists
	 */
	function olistener_create_table() {

		$charset = olistener()->get_wpdb()->get_charset_collate();
		$sql     = "CREATE TABLE IF NOT EXISTS " . OLISTENER_DATA_TABLE . " (
			id int(100) NOT NULL AUTO_INCREMENT,
			order_id int(100) NOT NULL,
			billing_name VARCHAR(255) NOT NULL,
			order_total int(100) NOT NULL,
			read_status VARCHAR(50) NOT NULL,
			datetime DATETIME NOT NULL,
			UNIQUE KEY id (id)
		) $charset;";

		require_once( ABSPATH . 'wp-admin/includes/upgrade.php' );
		dbDelta( $sql );
	}
}


if ( ! function_exists( 'olistener_create_webhook' ) ) {
	/**
	 * Create webhook if not exists
	 */
	function olistener_create_webhook() {
		try {
			$webhook_id  = olistener()->get_option( 'olistener_webhook_id' );
			$def_webhook = wc_get_webhook( $webhook_id );

			if ( ! $def_webhook instanceof WC_Webhook ) {
				$webhook = new WC_Webhook();
				$webhook->set_name( 'Order Listener' );
				$webhook->set_user_id( get_current_user_id() );
				$webhook->set_topic( 'order.created' );
				$webhook->set_delivery_url( site_url( 'wp-json/olistener/new' ) );
				$webhook->set_status( 'active' );
				$new_webhook_id = $webhook->save();

				if ( $new_webhook_id ) {
					update_option( 'olistener_webhook_id', $new_webhook_id );
				}
			}
		} catch ( Exception $e ) {
		}
	}
}


if ( ! function_exists( 'olistener_get_audio' ) ) {
	/**
	 * Get audio URL
	 *
	 * @return string
	 */
	function olistener_get_audio() {

		$audio_file = olistener()->get_option( 'olistener_settings_audio_file' );

		if ( ! olistener()->is_pro() || empty( $audio_file ) ) {
			$audio_file = 'data:audio/mpeg;base64,';
		}

		return $audio_file;
	}
}

